', '10 minutes', '{"Can you tell me about your nursing background and what inspired you to pursue a career in nursing?","What areas of nursing have you specialized in, and why did you choose those specialties?","How do you prioritize patient care when dealing with multiple patients with different levels of acuity?","Can you describe a time when you had to handle a medical emergency? What steps did you take, and what was the outcome?","How do you stay updated with the latest medical advancements and practices in nursing?","Youre working with a patient post-surgery, and they suddenly report difficulty breathing. What immediate actions would you take?","You notice that a patients medication dosage is incorrect on the chart. What steps would you follow to resolve this issue?","How do you handle conflict within a healthcare team, especially when it comes to differences in patient care approaches?","How do you ensure that patients feel comfortable and cared for during their hospital stay?","Describe a time when you provided emotional support to a patient or their family during a difficult situation.","What do you think is the most important quality a nurse should possess, and how do you embody that in your work?","How do you maintain work-life balance while working in a demanding healthcare environment?","Can you give an example of how you''ve collaborated with doctors or other healthcare professionals to improve patient outcomes?","What are your career goals in nursing, and how do you see yourself growing in this profession?"}', '/images/instructions-cover.png', 'https://resource.heygencdn.com/AIAvatars/caption.mp4', '{"This interview will assess your skills",sfda}', '2024-10-13 10:15:35.124397+00', 'e7d5ff76-fab3-444b-be00-9fca3e0185c2', 'd480898d-6802-4be7-a701-dd3b306eb09d', 'active', 'Version 2');


